import React from 'react';
import './FrameLayout.css';
import PageFooter from './../page_footer/PageFooter';
import PageHeader from './../page_header/PageHeader.js';

function FrameLayout({ props, children }) {
  return (
    <div className="frame-layout">
        {props.useCustomHeader !== true && 
            <PageHeader />}
        {props.useCustomHeader === true && 
            <div className="section header">
                <div className="background-dim-overlay"></div>
                <PageHeader />
                {/* Header content slot */}
            </div>}
        {children}
        {/* Page Body slot */}
        <PageFooter />
    </div>
  );
}

export default FrameLayout;
